  /* -------------------------------------------------- BACKGROUND */
  .card {
    cursor: default;
    padding: 0.5em 0;
  }
  html:not(.mobile) .card {
    padding: 0.5em;
  }
  .card::-webkit-scrollbar {
    display: none;
  }

  /* -------------------------------------------------- FLASHCARD */
  .prettify-flashcard {
    background-color: var(--card-bg);
    border-radius: 1em;
    border: 1px solid var(--card-border);
    box-shadow: var(--card-box-shadow) 0px 7px 14px 0px, var(--card-box-shadow) 0px 3px 6px 0px;
    color: var(--text-fg);
    font-family: var(--font-family);
    font-size: var(--font-size-regular);
    line-height: 1.5;
    margin: 0 auto;
    max-width: var(--card-max-width);
    text-align: var(--card-text-align);
    word-wrap: normal;
  }
  .mobile .prettify-flashcard { font-size: var(--font-size-small); }
  .prettify-flashcard ::selection {
    background-color: var(--text-bg-selected);
  }
  .cloze-type {
      text-align: left;
  }
  /* -------------------------------------------------- FIELDS */
  .prettify-field {
    margin: 0.75em;
    margin-bottom: 0.85em;
  }
  .mobile .prettify-field {
    margin: 0.25em;
    margin-bottom: 0.75em;
  }

  .prettify-field--back {
    color: var(--text-fg);
    font-size: var(--font-size-regular);
  }

  /* -------------------------------------------------- CLOZE */
  .cloze {
    border-radius: 0.25em;
    font-weight: bold;
    background-color: var(--cloze-bg);
    color: var(--cloze-fg);
    padding: 0.1em;
  }

  /* -------------------------------------------------- DECK */
  .prettify-deck {
    margin: 0.75em;
    margin-left: 1em;
    margin-bottom: 0.5em;
    display: flex;
    color: var(--text-fg-faint);
    font-size: var(--font-size-small);
  }
  .mobile .prettify-deck {
    margin: 1em;
  }

  /* -------------------------------------------------- TAGS */
  .prettify-tags {
    margin: 0.5em;
    margin-left: 1em;
    display: flex;
    flex-flow: row wrap;
    font-size: var(--font-size-small);
  }
  .mobile .prettify-tags {
    margin: 1em;
  }

  .prettify-tag {
    all: initial;
    background-color: var(--tag-bg);
    border-radius: 0.2em;
    color: var(--tag-fg);
    display: inline;
    font-size: var(--font-size-small);
    font-family: var(--font-family);
    margin: 0.25em;
    padding: 0.25em;
    transition: all 0.25s;
    word-break: break-word;
  }
  .prettify-tag:hover {
    background-color: var(--tag-bg-active);
    color: var(--tag-fg-active);
    cursor: pointer;
  }

  /* -------------------------------------------------- DIVIDER */
  .prettify-field hr { border: none; border-bottom: 1px dashed var(--divider); background-color: transparent; width: 80%;}
  .prettify-divider {
    background-color: transparent;
    border: none;
    border-bottom: 1px dashed var(--divider);
    margin: 1em;
    padding: 0;
  }
  .prettify-divider--answer {
    margin: 0 0 1em;
  }

  /* -------------------------------------------------- IMAGES */
  img {
    border-radius: 0.25em;
    display: block;
    margin: 1em auto;
    max-width: var(--img-width) !important;
    transition: max-width 0.25s 0.1s, opacity 0.25s 0.1s, filter 0.1s, transform 0s;
  }
  .night_mode img {
