  /* -------------------------------------------------- HYPERLINKS */
  a, a:visited {
    text-decoration: none;
    color: var(--link-fg);
  }
  a:hover, a:active {
    text-decoration: underline;
    color: var(--link-fg-active);
  }

  /* -------------------------------------------------- FORMATTING */
  b {
    color: none;
  }

  i {
    color: none;
  }

  b > i,
  i > b {
    color: none;
  }

  u {
    color: none;
  }

  hl {
      color: var(--highlight1);
  }
  hl2 {
      color: var(--highlight2);
  }
  hl3 {
      color: var(--highlight3);
  }
  hl4 {
      color: var(--highlight4);
  }
  /* -------------------------------------------------- END OF THEME */
  /*-------Kanging Around-------*/
  h1, h2, h3, h4, h5 { margin: 0em;}
  h1 {
      color: var(--h1-fg);
  }
  h2 {
      color: var(--h2-fg);
  }
